import csv

def get_dataset(file_name: str) -> list:

    dataset = []

    with open(file_name, newline = "") as athlete_events_csv:

        event_reader = csv.DictReader(athlete_events_csv, delimiter = ";")

        for line in event_reader:
            dataset.append(line)
            

    return dataset

